import React, {useEffect,useState } from 'react'
import { useNavigate } from 'react-router-dom'
import {saveStudent} from '../services/StudentService'

const AddStudentComponent = () => {

    const [name, setName]=useState([])
    const [contactNumber, setContactNumber]=useState([])
    const [address, setAddress]=useState([])
    const [pincode, setPincode]=useState([])
    const [password, setPassword]=useState([])
    const navigator=useNavigate();

    function save(e){
        e.preventDefault();
        const student= {name,contactNumber,address,pincode,password}
        console.log(student);
        saveStudent(student).then((response) => {
            localStorage.setItem('token','Bearer '+response.data.jwt)
            //console.log(localStorage.getItem('token'));
        })
        navigator('/listStudents')
    }


return (

    <div>
                <br></br>
                   <div className = "container">
                        <div className = "row">
                            <div className = "card col-md-6 offset-md-3 offset-md-3">
                                {
                                    <h3 className="text-center">Add Student Form</h3>
                                }
                                <div className = "card-body">
                                    <form>
                                        <div className = "form-group">
                                            <label> Student Name: </label>
                                            <input placeholder="Student Name" name="name" className="form-control" 
                                                value={name} onChange={(e) => setName(e.target.value)}/>
                                        </div>
                                        <div className = "form-group">
                                            <label> Student Contact Number: </label>
                                            <input placeholder="Student Contact Number" name="contactNumber" className="form-control" 
                                                value={contactNumber} onChange={(e) =>setContactNumber(e.target.value)}/>
                                        </div>
                                        <div className = "form-group">
                                            <label> Student Address: </label>
                                            <input placeholder="Student Address" name="address" className="form-control" 
                                                value={address} onChange={(e) => setAddress(e.target.value)}/>
                                        </div>
                                        <div className = "form-group">
                                            <label> Student Pincode: </label>
                                            <input placeholder="Student Pincode" name="pincode" className="form-control" 
                                                value={pincode} onChange={(e) =>setPincode(e.target.value)}/>
                                        </div>
                                        <div className = "form-group">
                                            <label> Password: </label>
                                            <input type="password" placeholder="Password" name="password" className="form-control" 
                                                value={password} onChange={(e) =>setPassword(e.target.value)}/>
                                        </div>
                                        <button className="btn btn-success" onClick={save}>Save</button>
                                        </form>
                                </div>
                            </div>
                        </div>

                   </div>
            </div>

)
}
export default AddStudentComponent
